import { JSONData } from "./interfaces";

async function getStockJSON(ticker: string): Promise<JSONData | string> {
    console.log(`fetching ${ticker} price `);
    try {
        const response = await fetch(`https://sandbox.iexapis.com/stable/stock/${ticker}/quote/?token=Tpk_dec7b122df1e4bce8e1ebe0e6632fc06`)
        let stockJSON = await response.json();
        stockJSON = await JSON.parse(stockJSON)
        return stockJSON
    } catch {
        return `Tried to fetch ${ticker}, but the stock wasn't found ):`;
    }
}

export default getStockJSON;
